import React from "react";
import axios from "axios";

class Home extends React.Component {
  constructor(props) {
    super(props);
  }
  changeHandler = (e) => {
    const el = e.target;
    this.setState({
      [el.name]: el.type === "file" ? el.files[0] : el.value,
    });
  };

  submitBaner = (e) => {
    e.preventDefault();

    const bodyFormData = new FormData(e.target); // pass in the form

    axios.post("http://127.0.0.1:8000/detectar-objeto", bodyFormData);
  };
  render() {
    return (
      <React.Fragment>
        <h2>Detectar Objeto</h2>
        <form onSubmit={this.submitBaner()} onChange={this.changeHandler()}>
          <div>
            <input type="file" name="img1" />
          </div>
          <button type="submit">Submit</button>
        </form>
      </React.Fragment>
    );
  }
}
export default Home;
